  We're talking crystal clear water, white sands beaches, and an amazing anchorage protected by a beautiful reef.  We really earned this landfall after our 16 day, 1,700 mile sail from the Andaman Islands, India.  \n\nAfter clearing in with the police we finally set our feet on terra firma and begin exploring this amazing place in the middle of the Indian Ocean.\n\nSubscribe at "},{"text":"http://youtube.com/svdelos","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIr9-_1-SY6gIVCgHxBR2ULQ3zSNbMkv3_7IKYWg==","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/svdelos","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/svdelos","nofollow":true}}},{"text":"\n\nOur Mission\nIt’s simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET there’s absolutely, positively, nothing more we’d rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\n"},{"text":"http://www.svdelos.com/buy-us-a-beer","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIr9-_1-SY6gIVCgHxBR2ULQ3zSNbMkv3_7IKYWg==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fwww.svdelos.com%2Fbuy-us-a-beer\u0026redir_token=Uzk5OMhMQ7pmuTPI5z7dLvZIjit8MTU5MzAzMDg5OEAxNTkyOTQ0NDk4\u0026v=WjALZ_-kplY\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fwww.svdelos.com%2Fbuy-us-a-beer\u0026redir_token=U our life. If doesn’t have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and don’t forget to SMILE!\n\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://www.svdelos.com/buy-us-a-beer\n\nCheck the links below for more SV Delos Sailing Around The World Action!\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\nwww.twitter.com/svdelossailing\n\n\n\nThis made possible by you!  Support S/V Delos Videos!\nhttp://www.svdelos.com/buy-us-a-beer\n\n00:01  Ramukanji by OneTox (https://www.youtube.com/watch?v=WNicT_k9YS0 )\n01:15 Up the mountains by Max Noremo ft. Purple Senses (www.soundcould.com/maxnoremo)\n01:36 Landras Dream by Audionautix  (licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/) Artist: http://audionautix.com/ )\n\n02:34 Hip Hop Christmas by Twin Musicom   (YouTube Audio Library)\n03:31 Festival by Max Noremo  (www.soundcould.com/maxnoremo)\n06:47 Spanish Summer by Audionautix is licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/)\nArtist: http://audionautix.com/\n\n08:44 Where I am From by Topher Mohr and Alex Elena   (YouTube Audio Library)\n09:29 Killer Bee by Phoebe Leyten  (Soundcloud.com/lelijveld)\n10:53 Coming up better by Ash Ball\n11:09 Green monster by Tatono   (www.tatono.bandcamp.com)\n13:43 From rock to stone by Chiba (Facebook.com/Chiba-325015586143)\n14:23 Sticky Bumps by jlbrock44 (featuring_Debbizo)     (dig.ccmixter.org)\n14:45 Mahi Mahi by Max Noremo ft. Purple Senses   (www.soundcould.com/maxnoremo)\n15:48 Standing Here by Silent Partner   (YouTube Audio Library)\
